import React from "react";
import { Row, Col } from "react-bootstrap";
import About from "./components/About";
import Experience from "./components/Experience";
import Projects from "./components/Projects";

function App() {
  return (
    <div className="content">

          <About window={window} />

          <Projects />

          <Experience />

    </div>
  );
}

export default App;


